import React, { useState } from 'react';
import events from '../data/EventsData'; // Ensure this file contains your event data with the updated structure
import MapComponent from '../components/MapComponent';
import EventCard from '../components/EventCard'; // Import the EventCard component

const Events = () => {
  const [selectedEvent, setSelectedEvent] = useState(null);

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">Upcoming Events</h1>
      <MapComponent selectedEvent={selectedEvent} />
      <div className="grid gap-6 mt-6">
        {events.map(event => (
          <div 
            key={event.id} 
            className="bg-white rounded-lg shadow-lg cursor-pointer"
            onClick={() => setSelectedEvent(event)}
          >
            <EventCard event={event} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Events;
